    height:220px; 
    background-color: #00bfa5;
    box-shadow:none;
`
const Messenger = ()=> {

    return (

        <component>
           <Header>
             <Toolbar>

             </Toolbar>
           </Header>
           <LoginDialog/>
        </component>

    )
}

export default Messenger;
